CREATE DATABASE  IF NOT EXISTS imdb_minima;
USE imdb_minima;

-- Comandos de borrado

DROP TABLE IF EXISTS actuaciones;
DROP TABLE IF EXISTS generos;
DROP TABLE IF EXISTS peliculas;
DROP TABLE IF EXISTS actores;

-- Comandos de creación de tabla

CREATE TABLE generos (
  movieid mediumint(8) unsigned NOT NULL,
  genre varchar(50) NOT NULL,
  PRIMARY KEY (movieid,genre)
);

CREATE TABLE actores (
  actorid mediumint(8) unsigned NOT NULL,
  name varchar(250) NOT NULL,
  sex enum('M','F') DEFAULT NULL,
  PRIMARY KEY (actorid)
);

CREATE TABLE peliculas (
  movieid mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  title varchar(400) NOT NULL,
  year varchar(100) DEFAULT NULL,
  PRIMARY KEY (movieid)
);

CREATE TABLE actuaciones (
  movieid mediumint(8) unsigned NOT NULL,
  actorid mediumint(8) unsigned NOT NULL,
  as_character varchar(200) CHARACTER SET utf8 DEFAULT NULL,
  prota integer(11), 
  PRIMARY KEY (movieid,actorid)
);

-- Comandos de creación de claves foráneas

ALTER TABLE generos ADD FOREIGN KEY (movieid) REFERENCES peliculas(movieid); 
ALTER TABLE actuaciones ADD FOREIGN KEY (movieid) REFERENCES peliculas(movieid); 
ALTER TABLE actuaciones ADD FOREIGN KEY (actorid) REFERENCES actores(actorid); 

